        function isLink(word){ return /https?:\/\/\S+/i.test(word);}
        function hasTooManyConsonantsOrVowels(word){ return /[bcdfghjklmnpqrstvwxz]{6,}/i.test(word) || /[aeiouy]{6,}/i.test(word);}
        function delay(ms){ return new Promise(resolve=>setTimeout(resolve,ms)); }

        function updateEditor(editor,text){
            if(editor.tagName.toLowerCase()==='textarea' || editor.tagName.toLowerCase()==='input') editor.value=text;
            else editor.innerHTML=text.replace(/\n/g,'<br>');
            ['input','keyup','paste','blur','compositionend'].forEach(evt=>editor.dispatchEvent(new Event(evt,{bubbles:true})));
        }

